import React, { Component } from "react";

import Skills from "../about/skills";

class About extends Component {
  componentDidMount() {
    console.log("About Loaded");
  }
  render() {
    return (
      <div className="about">
        <div className="about__me">
          <h1>About Me</h1>
          <h2>Who Am I?</h2>
          <p>
            Unless you've directly landed here skipping the homepage then my
            name is Aman Kumar (Pronounced "Aa-mun Koo-maar"). I am a Front End
            Web Developer from India. I spend 12 hours a day in front of my
            computer, 8 hours for coding, 2 hours for browsing reddit and the
            rest for playing video games. You can call me a workaholic. I love
            building projects for the web and just programming in general. My
            source of energy is willpower, commitment, a little bit of
            stubbornness and a lot of coffee.
          </p>

          <h2>So What Exactly Do I Do?</h2>
          <p>
            We already know that I'm a web developer, I build websites and web
            applications, but does a filmmaker just shoot vidoes? and a
            photographer just capture images? Well yeah, but my point is, I love
            my work, I take it very seriously and look at it as a lot more than
            just sitting on a desk and spewing out code.
          </p>

          <h2>I Like My Websites...</h2>
          <h3>Fast</h3>
          <h3>Responsive</h3>
          <h3>Dynamic</h3>
          <h3>Up To Date</h3>
          <h3>Compatible</h3>
        </div>
        <Skills />
      </div>
    );
  }
}

export default About;
